window.bookSummaryJSON = "<p><b>The Naturals are faced with their most chilling mysteries yet, in this stunning conclusion to the Naturals series by Jennifer Lynn Barnes, #1 </b><b><i>New York Times</i></b><b> bestselling author of </b><b><i>The Inheritance Games.</i></b></p> <p>When Cassie Hobbes joined the FBI's Naturals program, she had one goal: uncover the truth about her mother's murder. But now, everything Cassie thought she knew about what happened that night has been called into question. Her mother is alive, and the people holding her captive are more powerful—and dangerous—than anything the Naturals have faced so far. As Cassie and the team work to uncover the secrets of a group that has been killing in secret for generations, they find themselves racing a ticking clock. <i>New victims. New betrayals. New secrets.</i></p> <p>When the bodies begin piling up, it soon becomes apparent that this time, the Naturals aren't just hunting serial killers.</p> <p>They're being hunted.</p>"; 
